import axios from "axios";

const API_URL = process.env.REACT_APP_API_URL;

export async function getBookDetailAPI(ISBN: string) {
  try {
    const data = await axios({
      method: "GET",
      url: `${API_URL}/search`,
      params: {
        isbn: isbn,
      },
    });
    console.log(data)
    return data;
  } catch (e) {
    console.log(e);
  }
}
